import React, { Component } from "react"

class Navbar extends Component {
    render() {
        return (
            <div className="nav">
                <a href="#home">Home</a>
                <a href="#portfolio">Portfolio</a>
                <a href="#contact">Contact</a>
            </div>
        )
    }
}

export default Navbar
